import React from 'react';

import "./style.css";

export default function Carpoolify() {
    return (
        <div>
            {/* <p>[Carpoolify summary]</p> */}

            <h6>Background</h6>
            <p>
                Carpoolify was the result of the first group project of the UW bootcamp I attened this past summer.
                I worked with 2 other talented developers in the class, <a href="https://www.linkedin.com/in/andrew-joung-4945b313a/">Andrew Joung</a> 
                and <a href="https://www.linkedin.com/in/scott-willis-1b600a178/">Scott Willis</a>, to build this
                application. Independently of each other, Scott and I both had the idea to try our hand at a carpool
                app for Project 1.
            </p>

            <p>
                While Carpoolify as a project doesn't employ any backend 
            </p>


        </div>
    )
}
